import * as React from "react";
import { Route, Switch } from "react-router-dom";
// Style
import './router-secure.styl'; 
import HomePage from "./HomePage/HomePage";
import EditorPage from "./EditorPage/EditorPage";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { 
  faArrowRight, faAnchor, faLock, faSync, faCheck, faExclamation,
} from '@fortawesome/free-solid-svg-icons'
// Components
import GutterMenu from "../../component/GutterMenu/GutterMenu";
import GutterUserSettings from "../../component/GutterUserSettings/GutterUserSettings";

import GutterInviteUser from "../../component/GutterInviteUser/GutterInviteUser";
import GutterUserInvites from "../../component/GutterUserInvites/GutterUserInvites";



import GutterCompanySettings from "../../component/GutterCompanySettings/GutterCompanySettings";
import GutterCompanyDecks from "../../component/GutterCompanyDecks/GutterCompanyDecks";
import GutterNewDeck from "../../component/GutterNewDeck/GutterNewDeck";

function SecureRouter() {

  const [getUserCookie, setUserCookie] = React.useState(JSON.parse(window.localStorage.getItem("user")));
  const [getPage, setPage] = React.useState({ inactive: false, css:'', overlay:false });
  const [getGutter, setGutter] = React.useState({ inactive: false, css:'', load:'' });
  const [getGutterLoader, setGutterLoader] = React.useState({ inactive: false, state:'', title:'', label:'' });

  //
  // Toggle Gutter
  //

  const toggleGutter = (load,css) => {
    if(load === '') {
      setGutter({...getGutter, css:'gutter-column-'+css+''});
    } else {
      setGutter({...getGutter, load:load, css:'gutter-column-'+css+''});
    }
    setPage({...getPage, inactive:true, overlay:true, css:'page-shift-right'});
  }

  //
  // Toggle Menu
  //

  const toggleMenu = () => {
    if(getPage.inactive) {
      setGutter({...getGutter, css:''});
      setPage({...getPage, inactive:false, overlay:false});
    } else {
      setGutter({...getGutter, css:'gutter-column-one-active'});
      setPage({...getPage, inactive:true, overlay:true, css:'page-shift-right'});
    }
  }

  //
  // Toggle Gutter Loader
  //

  const toggleGutterLoader = (inactive, state, title, label) => {
    setGutterLoader({...getGutterLoader, inactive:inactive, state:state, title:title, label:label});
  }

  //
  // Return
  //

  return (
    <>
      {/** Page */}
      <div className={ getPage.inactive ? `page ${getPage.css}`:`page`}>
        <div className={ getPage.overlay ? `page-overlay page-overlay-active`:`page-overlay`} onClick={() => toggleMenu()}></div>
        <Switch>
          <Route path="/home/e" exact render={(props) => <HomePage page={getPage} toggleMenu={toggleMenu} {...props}/>}/>
          <Route path="/editor" exact component={EditorPage} />
        </Switch>
      </div>
      {/** Gutter */}
      <div className="gutter-background">
        <div className={ `gutter ${getGutter.css}`}>
          <div className="gutter-column">
            {/** Decks */}
            { getGutter.load === 'company-decks' &&
              <GutterCompanyDecks 
                toggleMenu={toggleMenu} 
                toggleGutter={toggleGutter} 
                toggleGutterLoader={toggleGutterLoader}>
              </GutterCompanyDecks> 
            }
            { getGutter.load === 'create-deck' && 
              <GutterNewDeck 
                toggleMenu={toggleMenu} 
                toggleGutter={toggleGutter} 
                toggleGutterLoader={toggleGutterLoader}
              ></GutterNewDeck> 
            }
            {/** Invitations */}
            { getGutter.load === 'invite-user' &&
              <GutterInviteUser 
                toggleMenu={toggleMenu} 
                toggleGutter={toggleGutter} 
                toggleGutterLoader={toggleGutterLoader}>
              </GutterInviteUser> 
            }
            { getGutter.load === 'user-invites' &&
              <GutterUserInvites 
                userCookie={getUserCookie}
                toggleMenu={toggleMenu} 
                toggleGutter={toggleGutter} 
                toggleGutterLoader={toggleGutterLoader}>
              </GutterUserInvites> 
            }

            {/** Admin */}

            { getGutter.load === 'company-settings' && 
              <GutterCompanySettings 
                toggleMenu={toggleMenu} 
                toggleGutter={toggleGutter} 
                toggleGutterLoader={toggleGutterLoader}>
              </GutterCompanySettings> 
            }
            { getGutter.load === 'invite-new-user' &&
              <GutterInviteUser 
                toggleMenu={toggleMenu} 
                toggleGutter={toggleGutter} 
                toggleGutterLoader={toggleGutterLoader}>
              </GutterInviteUser> 
            }
            { getGutter.load === 'user-settings' &&
              <GutterUserSettings 
                toggleMenu={toggleMenu} 
                toggleGutter={toggleGutter} 
                toggleGutterLoader={toggleGutterLoader}>
              </GutterUserSettings> 
            }
          </div>
          <div className="gutter-column">
            <GutterMenu 
              userCookie={getUserCookie}
              toggleMenu={toggleMenu} 
              toggleGutter={toggleGutter} 
              toggleGutterLoader={toggleGutterLoader}>
            </GutterMenu>
          </div>
          <div className="clear-float"></div>
        </div>
        {/** Loader */}
        <div className={ !getGutterLoader.inactive ? `gutter-loader`:`gutter-loader gutter-loader-active`}>
          <div className={ getGutterLoader.state === 'loading' ? `loader-icon loader-icon-active`:`loader-icon`}>
            { getGutterLoader.state === 'loading' && <FontAwesomeIcon icon={faSync}/>}
            { getGutterLoader.state === 'error' && <FontAwesomeIcon icon={faExclamation}/>}
            { getGutterLoader.state === 'success' && <FontAwesomeIcon icon={faCheck}/>}
          </div>
          <div className="loader-text">
            <h1>{getGutterLoader.title}</h1>
            <p>{getGutterLoader.label}</p>
          </div>
        </div>
      </div>
    </>
  );
}

export default SecureRouter;
